    return(
        <div className="bg-gray-700">
        <div className="h-screen w-32 pt-3 pl-2 bg-gray-900">
          <ul className="flex flex-col gap-2">
              <li className="text-3xl text-gray-50">item 1</li>
              <li className="text-3xl text-gray-50">item 2</li>
          </ul>  
        </div>
        </div>
    )

}

export default NavBar;
